const baseUrl = 'http://openhab-production.openhab:8080/rest/persistence/items';

// Ber√§kna tidsintervall f√∂r denna vecka och f√∂rra veckan
const now = new Date();
const thisWeekStart = new Date(now);
thisWeekStart.setDate(thisWeekStart.getDate() - 7);
const lastWeekStart = new Date(thisWeekStart);
lastWeekStart.setDate(lastWeekStart.getDate() - 7);

const thisWeekStartStr = thisWeekStart.toISOString().split('T')[0] + 'T00:00:00';
const thisWeekEndStr = now.toISOString().split('T')[0] + 'T00:00:00';
const lastWeekStartStr = lastWeekStart.toISOString().split('T')[0] + 'T00:00:00';
const lastWeekEndStr = thisWeekStartStr;

const items = [
  'Currently_One_Currently_Used',
  'Currently_One_Currently_Using',
  'Currently_One_Currently_I1',
  'Currently_One_Currently_I2',
  'Currently_One_Currently_I3',
  'Compressor_State_Value_as_Switch',
  'Add_Heat_Status_Value_as_Number',
  'Radiator_Forward_Value_as_Number',
  'Outdoor_Temperature_Value_as_Number',
  'Warm_Water_Temperature_Value_as_Number',
  'HuddingeStation_IndoorTemperature'
];

// H√§mta data f√∂r b√•da veckorna
const thisWeekData = {};
const lastWeekData = {};

for (const item of items) {
  thisWeekData[item] = await this.helpers.httpRequest({
    method: 'GET',
    url: `${baseUrl}/${item}?starttime=${thisWeekStartStr}&endtime=${thisWeekEndStr}`,
  });
  lastWeekData[item] = await this.helpers.httpRequest({
    method: 'GET',
    url: `${baseUrl}/${item}?starttime=${lastWeekStartStr}&endtime=${lastWeekEndStr}`,
  });
}

// --- H√ÑMTA SPOTPRISER FR√ÖN ELPRISET JUST NU (SE3) ---
const fetchSpotPrices = async (startDate, endDate) => {
  let totalSek = 0;
  let count = 0;
  let minPrice = Infinity;
  let maxPrice = -Infinity;
  const d = new Date(startDate);
  const end = new Date(endDate);
  while (d < end) {
    const mm = String(d.getMonth() + 1).padStart(2, '0');
    const dd = String(d.getDate()).padStart(2, '0');
    const url = `https://www.elprisetjustnu.se/api/v1/prices/${d.getFullYear()}/${mm}-${dd}_SE3.json`;
    try {
      const prices = await this.helpers.httpRequest({ method: 'GET', url });
      for (const p of prices) {
        const sek = p.SEK_per_kWh;
        totalSek += sek;
        count++;
        if (sek < minPrice) minPrice = sek;
        if (sek > maxPrice) maxPrice = sek;
      }
    } catch (e) { /* skip days without data */ }
    d.setDate(d.getDate() + 1);
  }
  if (count === 0) return { avg: 'N/A', min: 'N/A', max: 'N/A' };
  return {
    avg: (totalSek / count).toFixed(2),
    min: minPrice.toFixed(2),
    max: maxPrice.toFixed(2)
  };
};

const thisWeekSpot = await fetchSpotPrices(thisWeekStart, now);
const lastWeekSpot = await fetchSpotPrices(lastWeekStart, thisWeekStart);

// Ber√§kna energif√∂rbrukning
const calcEnergyUsage = (data) => {
  const d = data.data || [];
  if (d.length < 2) return 0;
  return parseFloat(d[d.length - 1]?.state || 0) - parseFloat(d[0]?.state || 0);
};

const thisWeekUsage = calcEnergyUsage(thisWeekData['Currently_One_Currently_Used']).toFixed(1);
const lastWeekUsage = calcEnergyUsage(lastWeekData['Currently_One_Currently_Used']).toFixed(1);
const usageDiff = (thisWeekUsage - lastWeekUsage).toFixed(1);
const usageDiffPercent = lastWeekUsage > 0 ? ((usageDiff / lastWeekUsage) * 100).toFixed(0) : 0;

// Ber√§kna elkostnad (spotpris exkl moms, l√§gg till 25% moms + n√§tavgift ~0.40 kr/kWh)
const calcCost = (usage, avgSpot) => {
  if (avgSpot === 'N/A') return 'N/A';
  const spotInklMoms = parseFloat(avgSpot) * 1.25;
  const totalPerKwh = spotInklMoms + 0.40;
  return (usage * totalPerKwh).toFixed(0);
};
const thisWeekCost = calcCost(thisWeekUsage, thisWeekSpot.avg);
const lastWeekCost = calcCost(lastWeekUsage, lastWeekSpot.avg);

// Ber√§kna toppeffekt per vecka
const calcPeakPower = (data) => {
  const values = data.data?.map(d => parseFloat(d.state)).filter(v => !isNaN(v)) || [];
  return values.length ? Math.max(...values).toFixed(0) : 'N/A';
};

const thisWeekPeakPower = calcPeakPower(thisWeekData['Currently_One_Currently_Using']);
const lastWeekPeakPower = calcPeakPower(lastWeekData['Currently_One_Currently_Using']);

// Ber√§kna max str√∂m per fas
const calcMaxCurrent = (data) => {
  const values = data.data?.map(d => parseFloat(d.state)).filter(v => !isNaN(v)) || [];
  return values.length ? Math.max(...values).toFixed(1) : 'N/A';
};

const thisWeekMaxI1 = calcMaxCurrent(thisWeekData['Currently_One_Currently_I1']);
const thisWeekMaxI2 = calcMaxCurrent(thisWeekData['Currently_One_Currently_I2']);
const thisWeekMaxI3 = calcMaxCurrent(thisWeekData['Currently_One_Currently_I3']);
const lastWeekMaxI1 = calcMaxCurrent(lastWeekData['Currently_One_Currently_I1']);
const lastWeekMaxI2 = calcMaxCurrent(lastWeekData['Currently_One_Currently_I2']);
const lastWeekMaxI3 = calcMaxCurrent(lastWeekData['Currently_One_Currently_I3']);

// Ber√§kna medeltemperatur
const calcAvgTemp = (data) => {
  const values = data.data?.map(d => parseFloat(d.state)).filter(v => !isNaN(v)) || [];
  return values.length ? (values.reduce((a, b) => a + b, 0) / values.length).toFixed(1) : 'N/A';
};

const calcMinMaxTemp = (data) => {
  const values = data.data?.map(d => parseFloat(d.state)).filter(v => !isNaN(v)) || [];
  if (values.length === 0) return { min: 'N/A', max: 'N/A' };
  return { min: Math.min(...values).toFixed(1), max: Math.max(...values).toFixed(1) };
};

const thisWeekAvgTemp = calcAvgTemp(thisWeekData['Outdoor_Temperature_Value_as_Number']);
const lastWeekAvgTemp = calcAvgTemp(lastWeekData['Outdoor_Temperature_Value_as_Number']);
const thisWeekTempRange = calcMinMaxTemp(thisWeekData['Outdoor_Temperature_Value_as_Number']);
const lastWeekTempRange = calcMinMaxTemp(lastWeekData['Outdoor_Temperature_Value_as_Number']);

const thisWeekAvgIndoor = calcAvgTemp(thisWeekData['HuddingeStation_IndoorTemperature']);
const lastWeekAvgIndoor = calcAvgTemp(lastWeekData['HuddingeStation_IndoorTemperature']);
const thisWeekIndoorRange = calcMinMaxTemp(thisWeekData['HuddingeStation_IndoorTemperature']);
const lastWeekIndoorRange = calcMinMaxTemp(lastWeekData['HuddingeStation_IndoorTemperature']);

const thisWeekAvgRadiator = calcAvgTemp(thisWeekData['Radiator_Forward_Value_as_Number']);
const lastWeekAvgRadiator = calcAvgTemp(lastWeekData['Radiator_Forward_Value_as_Number']);

// Ber√§kna varmvattentemperatur (medel och max)
const thisWeekAvgHotWater = calcAvgTemp(thisWeekData['Warm_Water_Temperature_Value_as_Number']);
const lastWeekAvgHotWater = calcAvgTemp(lastWeekData['Warm_Water_Temperature_Value_as_Number']);
const thisWeekHotWaterRange = calcMinMaxTemp(thisWeekData['Warm_Water_Temperature_Value_as_Number']);
const lastWeekHotWaterRange = calcMinMaxTemp(lastWeekData['Warm_Water_Temperature_Value_as_Number']);

// Ber√§kna kompressortid
const calcCompressorHours = (data) => {
  const d = data.data || [];
  let minutes = 0;
  for (let i = 1; i < d.length; i++) {
    if (d[i].state === 'ON') {
      minutes += (d[i].time - d[i-1].time) / 60000;
    }
  }
  return (minutes / 60).toFixed(1);
};

const thisWeekCompressorHours = calcCompressorHours(thisWeekData['Compressor_State_Value_as_Switch']);
const lastWeekCompressorHours = calcCompressorHours(lastWeekData['Compressor_State_Value_as_Switch']);

// Ber√§kna tillskottsv√§rme
const calcAddHeatHours = (data) => {
  const d = data.data || [];
  let minutes = 0;
  for (let i = 1; i < d.length; i++) {
    if (parseFloat(d[i].state) > 0) {
      minutes += (d[i].time - d[i-1].time) / 60000;
    }
  }
  return (minutes / 60).toFixed(1);
};

const thisWeekAddHeatHours = calcAddHeatHours(thisWeekData['Add_Heat_Status_Value_as_Number']);
const lastWeekAddHeatHours = calcAddHeatHours(lastWeekData['Add_Heat_Status_Value_as_Number']);

// Ber√§kna daglig snittf√∂rbrukning
const thisWeekDailyAvg = (thisWeekUsage / 7).toFixed(1);
const lastWeekDailyAvg = (lastWeekUsage / 7).toFixed(1);

// Ber√§kna kompressor procent av veckan
const thisWeekCompressorPercent = ((thisWeekCompressorHours / 168) * 100).toFixed(0);
const lastWeekCompressorPercent = ((lastWeekCompressorHours / 168) * 100).toFixed(0);

// Ber√§kna veckonummer
const getWeekNumber = (d) => {
  const date = new Date(d);
  date.setHours(0, 0, 0, 0);
  date.setDate(date.getDate() + 3 - (date.getDay() + 6) % 7);
  const week1 = new Date(date.getFullYear(), 0, 4);
  return 1 + Math.round(((date - week1) / 86400000 - 3 + (week1.getDay() + 6) % 7) / 7);
};
const thisWeekNum = getWeekNumber(thisWeekStart);
const lastWeekNum = getWeekNumber(lastWeekStart);

// Uppskatta COP baserat p√• utomhustemp och framledningstemp
const estimateCOP = (outdoorAvg, radiatorAvg) => {
  if (outdoorAvg === 'N/A' || radiatorAvg === 'N/A') return 'N/A';
  const tOut = parseFloat(outdoorAvg);
  const tFwd = parseFloat(radiatorAvg);
  const tSource = tOut > 0 ? 2 + tOut * 0.3 : 2 + tOut * 0.15;
  const carnot = (tFwd + 273.15) / ((tFwd + 273.15) - (tSource + 273.15));
  const cop = carnot * 0.45;
  return cop.toFixed(1);
};
const thisWeekCOP = estimateCOP(thisWeekAvgTemp, thisWeekAvgRadiator);
const lastWeekCOP = estimateCOP(lastWeekAvgTemp, lastWeekAvgRadiator);

// Best√§m s√§song
const month = now.getMonth() + 1;
let season = 'v√•r';
if (month >= 6 && month <= 8) season = 'sommar';
else if (month >= 9 && month <= 11) season = 'h√∂st';
else if (month === 12 || month <= 2) season = 'vinter';

const report = `# Veckoanalys Energi v.${thisWeekNum} (${season}) üìä

**DENNA VECKA v.${thisWeekNum}** (${thisWeekStart.toLocaleDateString('sv-SE')} - ${now.toLocaleDateString('sv-SE')})
- Total f√∂rbrukning: ${thisWeekUsage} kWh (snitt ${thisWeekDailyAvg} kWh/dag)
- Uppskattad elkostnad: ${thisWeekCost} kr (snitt ${thisWeekSpot.avg} kr/kWh exkl moms, min ${thisWeekSpot.min}, max ${thisWeekSpot.max})
- Toppeffekt: ${thisWeekPeakPower} W
- Max str√∂m: L1=${thisWeekMaxI1}A, L2=${thisWeekMaxI2}A, L3=${thisWeekMaxI3}A
- Utomhustemp: medel ${thisWeekAvgTemp}¬∞C (min ${thisWeekTempRange.min}¬∞C, max ${thisWeekTempRange.max}¬∞C)
- Inomhustemp: medel ${thisWeekAvgIndoor}¬∞C (min ${thisWeekIndoorRange.min}¬∞C, max ${thisWeekIndoorRange.max}¬∞C)
- Framledning radiator: medel ${thisWeekAvgRadiator}¬∞C
- Varmvatten: medel ${thisWeekAvgHotWater}¬∞C (min ${thisWeekHotWaterRange.min}¬∞C, max ${thisWeekHotWaterRange.max}¬∞C)
- Kompressor drifttid: ${thisWeekCompressorHours}h (${thisWeekCompressorPercent}%)
- Tillskottsv√§rme: ${thisWeekAddHeatHours}h
- Uppskattad COP: ${thisWeekCOP}

**F√ñRRA VECKAN v.${lastWeekNum}** (${lastWeekStart.toLocaleDateString('sv-SE')} - ${thisWeekStart.toLocaleDateString('sv-SE')})
- Total f√∂rbrukning: ${lastWeekUsage} kWh (snitt ${lastWeekDailyAvg} kWh/dag)
- Uppskattad elkostnad: ${lastWeekCost} kr (snitt ${lastWeekSpot.avg} kr/kWh exkl moms)
- Toppeffekt: ${lastWeekPeakPower} W
- Max str√∂m: L1=${lastWeekMaxI1}A, L2=${lastWeekMaxI2}A, L3=${lastWeekMaxI3}A
- Utomhustemp: medel ${lastWeekAvgTemp}¬∞C (min ${lastWeekTempRange.min}¬∞C, max ${lastWeekTempRange.max}¬∞C)
- Inomhustemp: medel ${lastWeekAvgIndoor}¬∞C (min ${lastWeekIndoorRange.min}¬∞C, max ${lastWeekIndoorRange.max}¬∞C)
- Framledning radiator: medel ${lastWeekAvgRadiator}¬∞C
- Varmvatten: medel ${lastWeekAvgHotWater}¬∞C (min ${lastWeekHotWaterRange.min}¬∞C, max ${lastWeekHotWaterRange.max}¬∞C)
- Kompressor drifttid: ${lastWeekCompressorHours}h (${lastWeekCompressorPercent}%)
- Tillskottsv√§rme: ${lastWeekAddHeatHours}h
- Uppskattad COP: ${lastWeekCOP}

**F√ñR√ÑNDRING**
- Energi: ${usageDiff > 0 ? '+' : ''}${usageDiff} kWh (${usageDiff > 0 ? '+' : ''}${usageDiffPercent}%)
- Kostnad: ${thisWeekCost !== 'N/A' && lastWeekCost !== 'N/A' ? (thisWeekCost - lastWeekCost > 0 ? '+' : '') + (thisWeekCost - lastWeekCost) + ' kr' : 'N/A'}
- Utomhustemp: ${(thisWeekAvgTemp - lastWeekAvgTemp).toFixed(1)}¬∞C skillnad
- Kompressor: ${(thisWeekCompressorHours - lastWeekCompressorHours).toFixed(1)}h skillnad
- Tillskottsv√§rme: ${(thisWeekAddHeatHours - lastWeekAddHeatHours).toFixed(1)}h skillnad
- COP: ${thisWeekCOP !== 'N/A' && lastWeekCOP !== 'N/A' ? (thisWeekCOP - lastWeekCOP).toFixed(1) : 'N/A'} skillnad`;

return [{ json: { report, thisWeekUsage, lastWeekUsage, usageDiffPercent, thisWeekPeakPower, thisWeekAvgTemp, lastWeekAvgTemp, thisWeekCost, lastWeekCost, thisWeekCOP, lastWeekCOP, season } }];
